import React from 'react';
import { Card, CardContent, Typography } from '@mui/material';

const whiteTextStyle = {
  color: '#FFFFFF',
  textAlign: 'justify',
  fontSize: '18px',
};

const AnotherCustomCard = ({ title, content }) => {
  return (
    <Card style={{ backgroundColor: '#19506e', marginBottom: '20px' }}>
      <CardContent>
        <Typography variant="h6" style={whiteTextStyle}>
          {title}
        </Typography>
        <Typography variant="body2" style={whiteTextStyle}>
          {content}
        </Typography>
      </CardContent>
    </Card>
  );
};

export default AnotherCustomCard;
